(()=>{var c=()=>{document.addEventListener("DOMContentLoaded",()=>{let n=document.querySelector(".btn"),p=document.querySelector("#app");n.addEventListener("click",()=>{fetch("https://jsonplaceholder.typicode.com/posts").then(e=>e.json()).then(e=>{console.log(e),e.forEach(t=>{let o=document.createElement("article");o.innerHTML=`<h2 class="card__title">${t.title}</h2>
                                  <p class="card__body">${t.body}</p>`,p.append(o)})})})})};c();})();
